//Transformation de données : ici formatage de date
import java.time.format.DateTimeFormatter
import java.sql.Timestamp
import java.sql.Date

val return_date = udf((date: Timestamp, format: String) => {
  val possibleDate = Option(date)
  possibleDate.map(_.toLocalDateTime().format(DateTimeFormatter.ofPattern(format))).getOrElse("")
})

// Répartition: "répartition" des utilisateurs selon leur appartenance à une catégorie d'âge 
// et calcul de l'âge moyen par catégorie d'âge
val round = udf((value: Float) => {
    Math round value
})

import org.apache.spark.sql._
import collection.JavaConverters._

val ages = usersWithRange.groupBy("ageRange").agg(
    round(mean(col("age"))).as("meanAge"),
    count("id").as("Count")
    )

import org.apache.spark.sql.expressions.Window

val medianAges = Window.partitionBy(usersWithRange.col("ageRange")).orderBy("age")

usersWithRange.selectPlus(ntile(5).over(medianAges)).show

//.withColumn("medianAge", usersWithRange.stat.approxQuantile("age", List(0.5d).toArray, 0d))



//z.show(medianAges)

// Représentation visuelle avec histogramme groupés avec la répartition d'âge par genre ((bar chart: keys = ageRange, Groups: gender, Values: Count SUM)
val agesPerGender = usersWithRange.groupBy("ageRange", "gender").agg(
    round(mean(col("age"))).as("meanAge"),
    count(lit(1)).as("Count")
    )

z.show(agesPerGender)
